import React, { Component } from 'react'
import axios from 'axios';

export default class logs extends Component {

    constructor(props){
        super(props);
        this.state = {
            data : [],
            limit: 20
        }
    }

    componentDidMount = () => {
        axios.get("logs")
        .then((response)=>{
            console.log(response.data)
        })
    }

    redirect = () =>{
        this.props.history.push("../")
    }

    render() {
        return (
            <div className="logs">

                <button id="searchpage" onClick={()=>this.redirect()}>Main Page</button>
                <div id="logtable">
                    <table>
                        <th>
                            <td>CLEINT</td>
                            <td>METHOD</td>
                            <td>STATUS</td>
                            <td>AGENT</td>
                        </th>
                        {this.state.data.map((data)=>{
                            return(
                            <tr>
                                <td>{data.client}</td>
                                <td>{data.method}</td>
                                <td>{data.code}</td>
                                <td>{data.agent}</td>
                            </tr>)
                        })}
                    </table>
                </div>
            </div>
        )
    }
}
